import { Injectable } from '@angular/core';
import { ComplicationDeveloppementPubertaire } from '../models/ComplicationDeveloppementPubertaire';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class DevpubService {

  private apiUrl = 'https://localhost:7129/api/ComplicationDeveloppementPubertaires';

  constructor(private http: HttpClient) { }
  addDevpub(ComplicationDeveloppementPubertaire: ComplicationDeveloppementPubertaire): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationDeveloppementPubertaire);

    return this.http.post<any>(`${this.apiUrl}/addDevpub`, ComplicationDeveloppementPubertaire, { observe: 'response' });
  }
  getComplicationdevpubById(id: number): Observable<ComplicationDeveloppementPubertaire> {
    return this.http.get<any>(`${this.apiUrl}/${id}`);
  }

  update(id: number, ComplicationDeveloppementPubertaire: ComplicationDeveloppementPubertaire): Observable<any> {
    return this.http.put(`${this.apiUrl}/update/${id}`, ComplicationDeveloppementPubertaire, { observe: 'response' });
}
}
